import React from 'react'

const Header = () => {
  return (
    <nav>
        <ul>
            <li><button><a href='/welcome'>Welcome</a></button></li>
            <li><a href='/products'>Products</a></li>
        </ul>
    </nav>
  )
}

export default Header
